INSERT INTO `fc_experiences` (`experience_id`, `experience_title`, `short_description`, `currency`, `price`, `user_id`, `type_id`, `date_count`, `total_hours`, `kit_content`, `experience_description`, `note_to_guest`, `location_description`, `location`, `group_size`, `guest_requirement`, `cancel_policy`, `language_list`, `video_url`, `status`, `added_date`, `featured`, `meta_title`, `meta_keyword`, `meta_description`, `host_status`, `security_deposit`, `page_view_count`) VALUES
(1, 'Homemade PastaaExp1', '', 'USD', '1000.00', 574, 2, 1, '5', '1,2,11,12', 'After a cappuccino and sweets Ill introduce you to three fresh pasta recipes, including their histories and ingredients. Well hunt down our provisions in the historic Sant Ambrogio neighborhood, meet shop owners, and make our way to a private restaurant / cooking school to knead, cut, mix, roll, and fill our pastas. Then well enjoy our creations with sauces, Tuscan wine, and a shot of espresso.', 'Better not to be celiac! Tell me wheter you prefer other dates to the ones you can see now online and I will do my best to satisfy your needs. You can do all the selfie you want!', 'Florences Sant''Ambrogio neighborhood features centuries-old family-run shops and the Sant''Ambrogio church, which first opened in the 1400s. We will do the cooking classes close in a spectacular kitchen with great view of all Florence.', '', 'There are 8 spots available on this experience.\nYou dont have to fill all of them. Experiences are meant to be social, so other travelers could join too.', 'All guests must be at least 18 years old and children cant come along.', '', '1,1461224967', 'https://a0.muscache.com/v/0f/f7/0ff7ed94-4664-4b00-8ba1-b220fcab94c0/0bfb435251535723a86d119078244c1f_1500k_1.mp4', '1', '2017-08-10 11:09:05', '1', '', '', '', '', '0.00', 11),
