INSERT INTO `fc_fancybox` (`id`, `name`, `excerpt`, `description`, `image`, `price`, `likes`, `comments`, `shipping_cost`, `tax`, `created`, `modified`, `seourl`, `category_id`, `price_range`, `purchased`, `status`, `meta_title`, `meta_keyword`, `meta_description`, `valid_date`) VALUES
(1, 'Diamond Packages ', 'Add some Fancy to your kitchen. Subscribe and receive a curated collection of the best gourmet', 'Add some Fancy to your kitchen. Subscribe and receive a curated collection of the best gourmet artisan foods around. Every month!\nEach Fancy Food Box includes five or more food products - anything from cookies and chocolates to teas and sauces - along with a selection of tasty recipes and pairing suggestions.\nBy purchasing this item, you hereby consent to a $39.00 monthly fee for the Fancy Box. Once payment is received, all orders will ship on the 5th of the following calendar month. All charges are billed on the day of original purchase and every 30 days thereafter. Subscription may be cancelled by updating your subscription preferences under your Fancy Box subscriptions: https://www.fancy.com/fancybox/manage. You can cancel your Fancy Box within 10 days of your last payment. If you cancel after 10 days, you will still receive your Fancy Box for that month, and your subscription will cease in the following month. Thank you for ordering the Fancy Box.\nShipping and handling not included in price. Allow 10 days from date of shipment for delivery.\nIn addition, to the maximum extent allowable by applicable law, Thing Daemon, and its officers, directors, employees, agents and suppliers specifically disclaim all liability resulting from personal injury and/or death resulting from, or arising out of, your use or consumption of products obtained through the Site, the Applications, or in connection with the services. Such disclaimer shall include, without limitation, mislabeling of products and/or ingredients. ', 'foodbox.jpeg,', 39.00, 0, 0, 12.00, 0.00, '2013-08-18 04:37:40', '2013-11-14 06:33:18', 'diamond-packages', '', '', 2, 'Publish', 'Diamond Packages ', 'Diamond Packages ', 'Diamond Packages ', '6'),
(2, 'Silver Packages ', 'Hey, it?s Coco. When I discover a new product or brand that I absolutely love I always like to', 'Hey, it?s Coco. When I discover a new product or brand that I absolutely love I always like to spreading the word. So when Fancy asked me to put together a box every month containing my latest finds, it was a perfect fit. It?s so much fun putting these boxes together, and I think its just as fun for subscribers, who each month receive a box filled with my latest faves-things like jewelry, nail polish, tech products and other cool things. The point is you never know exactly whats coming till you get it, but one thing?s for sure: each Fancy Box will have more than $80 worth of stuff inside-not bad considering you pay just $39!\nYou will receive a new box with top Fancy goodies each month. To manage your Fancy Box subscription, just go to your Fancy order history (http://www.fancy.com/purchases), find your Fancy Box order number and select "Manage Subscription" on your order page. \n\nBy purchasing this item, you hereby consent to a $39.00 monthly fee for the Fancy Box. Orders placed before the 24th of the calendar month will ship on the 30th of the same month. Orders placed after the 24th of the calendar month will ship on the 30th of the NEXT calendar month. All charges are billed on the day of original purchase and every 30 days thereafter. Subscription may be cancelled by updating your subscription preferences under your Fancy Box subscriptions: https://www.fancy.com/fancybox/manage. You can cancel your Fancy Box within 10 days of your last payment. If you cancel after 10 days, you will still receive your Fancy Box for that month, and your subscription will cease in the following month. Thank you for ordering the Fancy Box.\n\nShipping and handling not included in price. Allow 10 days from date of shipment for delivery.', ',', 55.00, 0, 0, 11.00, 0.00, '2013-08-18 07:51:33', '2013-11-14 06:32:46', 'silver-packages', '', '', 0, 'Publish', 'Coco Rocha Fancy Box Subscription', 'Coco Rocha Fancy Box Subscription', 'Coco Rocha Fancy Box Subscription', '3'),
(3, 'Free Package ', 'Free Package ', 'Free Package ', '44275_1_lg.jpg,', 0.00, 0, 0, 0.00, 0.00, '2013-11-14 11:27:15', '2013-11-14 06:26:00', 'free-package', '', '', 0, 'Publish', 'Free Package ', 'Free Package ', 'Free Package ', '1'),
