INSERT INTO `fc_review` (`id`, `rateVal`, `title`, `review`, `email`, `status`, `product_id`, `bookingno`, `dateAdded`, `user_type`, `owner_reply`, `user_id`, `reviewer_id`, `review_for`, `accuracy`, `communication`, `cleanliness`, `location`, `checkin`, `value`, `total_review`) VALUES
(7, 0, '', 'Great central location and Panagiotis was an excellent host. He came to meet us when we got lost and carried our luggage up the 10 flights of stairs! Would recommend stating here. :)', 'kumarkailash075@gmail.com', 'Active', 52, 'EN1500358', '2016-08-08 11:13:35', '', '', '51', '226', 'accuracy', 0, 0, 0, 0, 0, 0, 2),
(8, 0, '', 'The flat is a Little daimond in the centre of the city. It''s near Louvre and Notre-Dame. It''s inside a district that offer an intensive night Life. The Host was available and really Kind person.', 'kumarkailash075@gmail.com', 'Active', 63, 'EN1500418', '2016-08-08 13:28:59', '', '', '51', '226', 'accuracy', 0, 0, 0, 0, 0, 0, 4),
(9, 0, '', 'Wonderful apartment with very tasty restaurants right at the door. The place was adorable, very clean, and obviously well cared for. We had an amazing stay and would definitely recommend!', 'kumarkailash075@gmail.com', 'Active', 56, 'EN1500378', '2016-08-09 04:36:18', '', '', '51', '226', 'accuracy', 0, 0, 0, 0, 0, 0, 2),
(10, 0, '', 'Panagiotis was great, he was very helpful, and responded quickly. His apartment is in a perfect location, although it''s very small, it had all that we needed. About a block from the metro was very convenient as well. I highly recommend this location, as long as you don''t have more than two people.', 'kumarkailash075@gmail.com', 'Active', 61, 'EN1500408', '2016-08-09 04:37:33', '', '', '51', '226', 'accuracy', 0, 0, 0, 0, 0, 0, 3),
(11, 0, '', 'Panagiotis was the perfect host. He met us at a train station when we first arrived from our long haul flight from Australia and walked us to his apartment which was very helpful. The apartment is cosy but all you need as a base to explore Paris. It has a very good location near the Notre Dame, a slight walk to the Louvre and very close to a Metro station. I would definitely stay there again!', 'kumarkailash075@gmail.com', 'Active', 61, 'EN1500398', '2016-08-09 04:38:49', '', '', '51', '226', 'accuracy', 0, 0, 0, 0, 0, 0, 3),
(12, 0, '', 'My boyfriend and I had a lovely time in Paris! Our flight was delayed from NYC and we arrived a bit later than planned, but Panagiotis was very flexible and accommodating. He assisted us with directions and was there to greet us upon arrival. His studio is in a fabulous location, near a few train lines and many cafes, restaurants, clubs, and shops - very hip! The studio itself was cozy, clean and comfortable. Also because the studio faces the inside it was quiet which is a bonus in a busy neighborhood.', 'kumarkailash075@gmail.com', 'Active', 61, 'EN1500388', '2016-08-09 04:39:57', '', '', '51', '226', 'accuracy', 0, 0, 0, 0, 0, 0, 0),
(13, 0, '', 'Panagiotis'' place is a great little find in a wonderful location. Loved being only a 5 minute walk to Notre Dame and exploring the local neighborhood, super close to the metro station too which was very handy. Compact, clean room with everything we needed for a short stay. Bathroom is quite small but manageable. Not great for anyone who doesn''t like climbing lots of stairs. Thankyou Panagiotis, we would love to stay again :)', 'kumarkailash075@gmail.com', 'Active', 49, 'EN1500428', '2016-08-09 04:46:37', '', '', '51', '226', 'accuracy', 0, 0, 0, 0, 0, 0, 1),
(14, 0, '', 'First of all, Panagiotis is a truly great host. He is very kind, gives you as much information you need and is always available when you need something. The apartment is very accessible from the CDG-Airport (e.g. by using the blue line RER B).', 'kumarkailash075@gmail.com', 'Active', 57, 'EN1500438', '2016-08-09 04:47:09', '', '', '51', '226', 'accuracy', 0, 0, 0, 0, 0, 0, 1),
(15, 0, '', 'Best location in Paris and amazing host! Panagiotis was waiting for us when we arrived and he explained everything we needed to know for our stay here! Definitely will come back here when we are in Paris!', 'kumarkailash075@gmail.com', 'Active', 53, 'EN1500448', '2016-08-09 05:28:56', '', '', '51', '226', 'accuracy', 0, 0, 0, 0, 0, 0, 3),
(16, 0, '', 'The flat is very small--perfect for one person and okay for two. Tiny shower, tiny sink, 86 stairs to get to your flat. We are older (59) but in good physical condition.... So this was not a problem for us, but older guests may not want to climb the stairs. Many people smoke in Paris and it is hard to escape. We could smell smoke strongly in our apartment 2 nights, but went to the stairway hallway and opened a window which alleviated the problem. Don''t let this minor problem deter you, as this was a great 4 nights for us.', 'kumarkailash075@gmail.com', 'Active', 53, 'EN1500458', '2016-08-09 06:00:49', '', '', '51', '226', 'accuracy', 0, 0, 0, 0, 0, 0, 5),
(17, 0, '', 'He showed us how to unlock the door and even helped me up the stairs with my luggage. Although we didn''t watch tv he showed us how to use it and a listing of all programs in different languages. The wifi was great and listed on a convenient sheet with tv programming. The home was clean. Everything was great as stated other reviews and the location in the city was perfect.', 'kailashkumar.r@pofitec.com', 'Active', 49, 'EN1500468', '2016-08-09 06:08:22', '', '', '51', '231', 'accuracy', 0, 0, 0, 0, 0, 0, 3),
(18, 0, '', 'I recommended. Great stay in the heart of Paris. I don''t think I could have asked for a better location to stay in for my first visit to Paris. The apartment is small but has everything you need and since you are right in the centre of the city you probably won''t need to spend much time in the room anyway! Panagiotis is a great host - thanks again !!', 'kailashkumar.r@pofitec.com', 'Active', 54, 'EN1500488', '2016-08-09 06:28:52', '', '', '51', '231', 'accuracy', 0, 0, 0, 0, 0, 0, 3),
(19, 0, '', 'The studio is exactly as described and really right in the heart of Paris. Notre Dame, for example, is just 10 minutes by foot. Also, Panos was very polite and helpful. Altogether I highly recommended this.', 'kailashkumar.r@pofitec.com', 'Active', 54, 'EN1500498', '2016-08-09 07:03:15', '', '', '51', '231', 'accuracy', 0, 0, 0, 0, 0, 0, 2),
(20, 0, '', 'My wife and I had the pleasure of staying in this lovely studio Appartment. It was very well presented and had everything we needed to assist us with our stay. Panagiotis was very gracious and helpful host. The studio was dead central to everywhere and we really enjoyed our stay. I would have no concerns recommending this studio to anyone.', 'kailashkumar.r@pofitec.com', 'Active', 51, 'EN1500508', '2016-08-09 07:11:06', '', '', '51', '231', 'accuracy', 0, 0, 0, 0, 0, 0, 2),
(21, 0, '', 'Thank you for accept my booking. It is a nice product.', 'kailashkumar.r@pofitec.com', 'Active', 51, 'EN1500528', '2016-08-09 07:18:02', '', '', '51', '231', 'accuracy', 0, 0, 0, 0, 0, 0, 0),
(22, 0, '', 'Centrally located, nice decor and very comfortable bed. Important to note there are 86 steps to the apartment so if you have a lot of luggage or are not able to climb steps this may not be the location for you. In addition the apartment is fairly small (which is common for Europe) but can be problematic if you have a lot of luggage or are not small people.', 'chalesvictor.info@gmail.com', 'Active', 56, 'EN1500538', '2016-08-09 07:24:51', '', '', '51', '232', 'accuracy', 0, 0, 0, 0, 0, 0, 4),
(23, 0, '', 'This little studio was the perfect place to stay for our 3 nights in Paris. The area is lively with buzzing nightlife, and within walking distance to the Norte Darme, The Louvre and only a short bike ride to the Eiffel Tower!. There are many bars and restaurants and shops on your doorstep, yet the studio allows for peace and quiet at night. The fold out bed is very comfortable. Panagiotis was a great host, providing information before and as we arrived. We would definitely return if staying in Paris again.', 'chalesvictor.info@gmail.com', 'Active', 55, 'EN1500548', '2016-08-09 07:34:19', '', '', '51', '232', 'accuracy', 0, 0, 0, 0, 0, 0, 0),
(24, 0, '', 'Tiny but clean and practical flat in a lovely building and best location possible. It''s great value for money!', 'kailashkumar.r@pofitec.com', 'Active', 55, 'EN1500568', '2016-08-09 07:39:07', '', '', '51', '231', 'accuracy', 0, 0, 0, 0, 0, 0, 1),
(25, 0, '', 'This cozy place is very well located. It is walkable to many things including Notre Dame and part of the Seine. Panagiotis was super friendly and met us right on time. Communication was quick and efficient. We would totally stay at the same location if we have a chance to visit Paris again :).', 'kailashkumar.r@pofitec.com', 'Active', 57, 'EN1500578', '2016-08-09 07:48:27', '', '', '51', '231', 'accuracy', 0, 0, 0, 0, 0, 0, 2),
(26, 0, '', 'It was great to have a fellow Greek as our host in Paris! Our flight was unfortunately canceled so we flew in same time the next day. That change caused Panagiotis not to be able to meet us at the time scheduled, so we had to wander around Paris with our bags and suitcases for 3 hours. The apartment is as described and the pull out bed very comfortable. It was very clean and tidy though the towels were very small and bleached. The location of the apartment is wonderful!! In the heart of Marais, with all the sights just few steps away! Very lively with lot of bars and restaurants. We didn''t have to take the bus / metro for almost none of our visits. Exactly at the heart of the city! Would recommend Panagiotis apartment :)', 'kailashkumar.r@pofitec.com', 'Active', 59, 'EN1500608', '2016-08-09 07:59:08', '', '', '51', '231', 'accuracy', 0, 0, 0, 0, 0, 0, 5),
(27, 0, '', 'I will recommended to all', 'kailashkumar.r@pofitec.com', 'Active', 59, 'EN1500628', '2016-08-09 08:05:46', '', '', '51', '231', 'accuracy', 0, 0, 0, 0, 0, 0, 0),
(28, 0, '', 'It is a good property for stay. very luxery', 'kumarkailash075@gmail.com', 'Active', 60, 'EN1500638', '2016-08-09 08:16:58', '', '', '51', '226', 'accuracy', 0, 0, 0, 0, 0, 0, 0),
(29, 0, '', 'As described, located in the central district of Paris with only several blocks away from many famous culture sites. Also, needless to say, a lot of great restaurants around. Highly recommended.', 'kumarkailash075@gmail.com', 'Active', 60, 'EN1500648', '2016-08-09 08:26:36', '', '', '51', '226', 'accuracy', 0, 0, 0, 0, 0, 0, 5),
(30, 0, '', 'The flat is in the best possible location, in the middle of vibrant Marais quarter. It is immaculate, literally spotless and very well equipped. We loved our time there and Panagiotis is the absolute delight of a host.', 'kumarkailash075@gmail.com', 'Active', 63, 'EN1500658', '2016-08-09 08:36:37', '', '', '51', '226', 'accuracy', 0, 0, 0, 0, 0, 0, 5),
(31, 0, '', 'The space was exactly as described, cozy but cute and close to everything. Panagiotis was a great host.', 'kumarkailash075@gmail.com', 'Active', 62, 'EN1500668', '2016-08-09 08:43:10', '', '', '51', '226', 'accuracy', 0, 0, 0, 0, 0, 0, 4),
(32, 0, '', 'Economic Price range. good for this rate', 'kumarkailash075@gmail.com', 'Active', 62, 'EN1500678', '2016-08-09 09:51:01', '', '', '51', '226', 'accuracy', 0, 0, 0, 0, 0, 0, 4),
(33, 0, '', 'Property placed in wonderful place. well constructed', 'kumarkailash075@gmail.com', 'Active', 52, 'EN1500688', '2016-08-09 09:59:02', '', '', '51', '226', 'accuracy', 0, 0, 0, 0, 0, 0, 4),
(34, 0, '', 'It is Nice Place', 'charlesvictor.j@pofitec.com', 'Active', 53, 'EN1500778', '2016-08-10 07:34:59', '', '', '51', '234', 'accuracy', 0, 0, 0, 0, 0, 0, 0),
(35, 0, '', 'The Apartment is located in a beautiful Townhouse from the 1920s only 2 blocks from Central Park!\nThe lower level of the Duplex Apartment includes the large living room which is full of charm and offers tons of Exposed brick, fireplace, small dining area as well as access to the terrace which is fa', 'kumar@pofitec.com', 'Active', 54, 'EN1500808', '2016-08-10 11:18:24', '', '', '51', '229', 'accuracy', 0, 0, 0, 0, 0, 0, 2),
(36, 0, '', 'I was only there one night, but from the minute I got out of the car until I got back in the car to leave, I felt welcomed. Everyone made me feel comfortable and safe. I would definitely recommend the Taj hotel when visiting Delhi.', 'erkprajesh@gmail.com', 'Active', 69, 'EN1500828', '2016-08-10 11:54:57', '', '', '229', '241', 'accuracy', 0, 0, 0, 0, 0, 0, 0),
